UnsupportedNamespace = नेमस्पेस "%S" समर्थित नहीं है. कृपया "http://www.mozilla.org/2002/soap/security" का प्रयोग करें.
UnknownRootElement = रूट तत्व "%S" परिचित नहीं है. कृपया "webScriptAccess" तत्व का प्रयोग करें.
UnknownElement = तत्व "%S" परिचित नहीं है.
UnknownAttribute = विशेषता "%S" परिचित नहीं है.
TooManyElements = एक "%S" तत्व से अधिक नहीं हो सकता है.
ElementHasSibling = "%S" तत्व "%S" सिबलिंग नहीं रह सकता है.
ElementNotEmpty = "%S" तत्व को रिक्त होना चाहिए.
SOAPFault = SOAP { %S } %S आह्वान खराबी के रूप में परिणाम दिया: { %S } %S : %S.


